AMIG@S Y COLEGAS COLOMBIANOS EN NY, los invito mañana, 5:00 pm para que celebremos el gran lanzamiento del 49o Festival Folclórico de Ibague en la capital del mundo! 🔥
Aquí se dará un gran encuentro entre colombianos con música y danza típica de la region tolimense. Siendo de Ibague, me siento feliz y orgullosa de estar al frente de este gran lanzamiento con el fin de enaltecer la ciudad, visibilizar parte de su patrimonio como lo es este festival como parte de su desarrollo y crecimiento como ciudad a nivel cultural. Cosas cómo estás hacen que ibague tome otra cara frente al mundo y se reconozca como la capital musical de Colombia en el exterior. 

#MiCasaEstáDeFiesta 
@gotokmusic @alcaldiadeibague  @camaracomercioibague @cerox3tv 
