Antes del lanzamiento del festival folclórico de ibague en el Time Square, preparando el rodaje principal de lo que se venía … mañana les comparto lo hermoso y sentido que fue este encuentro con todos los colombianos ibaguereños, que hasta lloraron de ver a su gente tan cerca, tantas emociones encontradas de las que pudimos vivir y compartir con todos! Gracias a la @alcaldiadeibague y la @camaracomercioibague por visibilizar nuestra cultura ante el mundo. 💥🎶🚀🇨🇴🇨🇴🇨🇴
